<script>
$.fn.pTag = function(name){return this.first().append("<"+name+"></"+name+">").find(":last-child").last();}

<body>
<div id="main"/>
<div id="cont">

<ul id="list"></ul>
</div>

<br><br>
<script>
	$.fn.blurTransperent=function($p, image){
		let im = new Image();
		im.onload=()=>{
			let rh = window.screen.availHeight/im.height,
				rw = window.screen.availWidth/im.width;
			let r = rh>rw?rh:rw;
			$(this).css({"box-sizing": "border-box", position:"relative","border-radius": "10px",
				"background-color":"rgba(255, 255, 255, 0.5)",
				"overflow": "hidden"
			});
			let newDiv=$(this).pTag("div").css({
				"background-image":$p.css("background-image"),
				position:"absolute",
				"background-repeat":"no-repeat",
				"background-size":im.width*r+"px "+im.height*r+"px",
				filter:"blur(3px)",
				width:"100vw",
				height:"100vh",
				top:0,
				left:0,
				overflow:"hidden",
				"z-index":-1
			});
			let rect = newDiv[0].getBoundingClientRect();
			newDiv.css({top:"-"+rect.top+"px", left:"-"+rect.top+"px"});
		}
		im.src=image;
	}
	
	function pRef(ref,n){
		$("#list").pTag("li")
		.html('<a href="'+((ref.startsWith("http://") || ref.startsWith("https://"))?
			ref:"http://"+ref)+'" num="'+n+'">'+
			ref.replace("http://", '').replace("https://", "")+'</a>')
		.pTag("div").css({display:"inline-block", float:"right", "margin-right":"10px"})
		.pTag("input").css({height:"18px"}).attr({type:"button", value:"X"}).click(function(){
			localStorage.removeItem("ref"+$(this).parent().parent().find("a").attr("num"));
			$(this).parent().parent().remove();
		});
	};
	
	$("#main").pTag("input").attr({type:"text", id:"newRef"}).on('keyup', function(e){
		if(e.keyCode==13){
			e.preventDefault();
			$("#addId").click();
			$(this).val("");
		}
	}).out()
	.pTag("input").attr({type: "button", value:"add", id:"addId"}).click(function(){
		localStorage.setItem("count", (localStorage.getItem("count")|0)+1);
		localStorage.setItem("ref"+localStorage.getItem("count"), $("#newRef").val());
		pRef($("#newRef").val(), localStorage.getItem("count"));
	}).out().append("<br><br>").pTag("input").attr({type:"button", value:"Reset all"}).click(function(){
		localStorage.clear();
		window.location.reload(true);
	});
	
	Object.keys(localStorage).forEach(v => {
		if(v.startsWith("ref"))pRef(localStorage[v], v.substring(3));
	});
		
	$(document).ready(function(){
		$(window).on('dragenter', function(e){
			e.preventDefault();
			e.stopPropagation();
		});
		$("body").bind("dragover", function(e){
			e.preventDefault();
			e.stopPropagation();
			//$(this).addClass("drag");
		})
		$("body").bind("dragleave", function(e){
			e.preventDefault();
			e.stopPropagation();
			//if(!e.relatedTarget)$(this).removeClass("drag");
		})
		
		reader = new FileReader();
		reader.onload=function(e){
			localStorage.setItem("pic", e.target.result);
			$("body").css({"background-image":"url("+localStorage.getItem("pic")+")"});
			$("#cont").blurTransperent($("body"), localStorage.getItem("pic"));
		}
		if(localStorage.getItem("pic")){
			$("body").css({"background-image":"url("+localStorage.getItem("pic")+")",
				"background-size":"cover"});
		}
		
		$("#cont").blurTransperent($("body"), localStorage.getItem("pic"));
		
		$("body").on('drop', function(e){
			$(this).removeClass("drag");
			e.preventDefault();
			e.stopPropagation();
			
			reader.readAsDataURL(e.originalEvent.dataTransfer.files[0]);
		})
	});
</script>
